import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import Toast from "../components/Toast";

const SignUp = ({ setLoading }) => {
  const navigate = useNavigate();
  const [formData, setFormData] = useState({
    email: "",
    password: "",
    username: "",
    fullName: "",
  });
  const [toastMessage, setToastMessage] = useState(null);
  const [toastType, setToastType] = useState("");

  const handleSignInClick = () => {
    navigate("/SignIn");
  };

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    try {
      const response = await fetch("http://localhost:5000/api/auth/register", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(formData),
      });

      const data = await response.json();
      if (response.ok) {
        setToastMessage(data.message);
        setToastType("success");
        setTimeout(() => {
          navigate("/SignIn");
        }, 3000);
      } else {
        setToastMessage(data.error);
        setToastType("error");
      }
    } catch (err) {
      setToastMessage("Error registering user. Please try again.");
      setToastType("error");
    } finally {
      setLoading(false);
    }
  };

  return (
    <div>
      {toastMessage && (
        <Toast
          message={toastMessage}
          type={toastType}
          onClose={() => {
            setToastMessage(null);
            setToastType("");
          }}
        />
      )}
      <section>
        <div className="mx-auto w-full max-w-3xl px-5 py-16 md:px-10 md:py-20">
          <div className="relative mx-auto max-w-xl bg-gray-100 px-8 py-12 text-center">
            <svg
              className="absolute top-3 right-3 sm:top-7 sm:right-7 cursor-pointer"
              onClick={() => navigate("/dashboard")}
              width="24"
              height="24"
              viewBox="0 0 24 24"
              fill="none"
              xmlns="http://www.w3.org/2000/svg"
            >
              <path
                d="M5.25 5.25L18.75 18.75"
                stroke="black"
                strokeWidth="2"
                strokeLinecap="round"
                strokeLinejoin="round"
              />
              <path
                d="M5.25 18.75L18.75 5.25"
                stroke="black"
                strokeWidth="2"
                strokeLinecap="round"
                strokeLinejoin="round"
              />
            </svg>

            <div className="mx-auto w-full max-w-md">
              <form onSubmit={handleSubmit}>
                <div className="mb-6">
                  <label className="font-bold mb-1 text-left">Email</label>
                  <input
                    type="email"
                    name="email"
                    className="block w-full h-9 rounded-md border border-black px-3 py-1 text-sm text-black placeholder:text-black"
                    placeholder="Email Address"
                    value={formData.email}
                    onChange={handleInputChange}
                    required
                  />
                </div>
                <div className="mb-6">
                  <label className="font-bold mb-1 text-left">Password</label>
                  <input
                    type="password"
                    name="password"
                    className="block w-full h-9 rounded-md border border-black px-3 py-1 text-sm text-black placeholder:text-black"
                    placeholder="Password (min 8 characters)"
                    value={formData.password}
                    onChange={handleInputChange}
                    required
                  />
                </div>
                <div className="mb-6">
                  <label className="font-bold mb-1 text-left">Username</label>
                  <input
                    type="text"
                    name="username"
                    className="block w-full h-9 rounded-md border border-black px-3 py-1 text-sm text-black placeholder:text-black"
                    placeholder="Username"
                    value={formData.username}
                    onChange={handleInputChange}
                    required
                  />
                </div>
                <div className="mb-6">
                  <label className="font-bold mb-1 text-left">
                    Nama Lengkap
                  </label>
                  <input
                    type="text"
                    name="fullName"
                    className="block w-full h-9 rounded-md border border-black px-3 py-1 text-sm text-black placeholder:text-black"
                    placeholder="Nama Lengkap"
                    value={formData.fullName}
                    onChange={handleInputChange}
                    required
                  />
                </div>
                <input
                  type="submit"
                  value="Sign Up"
                  className="inline-block w-full cursor-pointer rounded-md bg-black px-6 py-3 text-center font-semibold text-white"
                />
              </form>

              <p className="mt-6">
                Already have an account?{" "}
                <span
                  onClick={handleSignInClick}
                  className="font-bold underline cursor-pointer"
                >
                  Sign In
                </span>
              </p>
            </div>
          </div>
        </div>
      </section>
    </div>
  );
};

export default SignUp;
